import Buttons from "../elements/Buttons";
import DaysMowedPerWeek from "../inputs/DaysMowedPerWeek";
import Inputs from "../inputs/Inputs";

const Step3 = ({
  customerInputs,
  handleChange,
  handleClick,
  whichStep,
  setWhichStep,
  setPADDRegion,
  setCustomerInputs,
}) => {
  return (
    <div className="main container-inputs">
      <h2>Step3</h2>
      <ul className="inputs" id="inputs">
        <li className="column range">
          <DaysMowedPerWeek
            {...{
              customerInputs,
              handleChange,
              handleClick,
              inStep: true,
              whichStep,
            }}
          />
        </li>
      </ul>
      <Buttons {...{ whichStep, setWhichStep }} />
      <Inputs {...{ setPADDRegion, customerInputs, setCustomerInputs }} />
    </div>
  );
};

